        "description": "Skiing my favorite lines, cliffs and couloirs around Jackson Hole in my edit \"Gettin' Sendy\". Follow along on https://www.instagram.com/o_leeps/ for more!\n\nTons of ski lines in the backcountry off the tram, sketchy couloirs, blower powder and sending some huge frontflips with Julian Carr. I also made it out to backflip the Palisades at Squaw Valley along with a few other sick in-bounds airs. \n\nCheck out my eBook for what cameras I used to shoot this edit!\nhttps://www.owenleeper.com/product/insta360-tips-tricks/\n\nMusic:\n\n\"No Limits\" \nPerformed by Royal Deluxe\nCourtesy of Position Music\n\n\"Another Level\" \nPerformed by Oh The Larceny\nCourtesy of Position Music",
